SELECT id_client, id_coach, COUNT(id) FROM sessions_list GROUP BY id_client,id_coach ORDER BY id_client;

-- добавляем время окончания сессии
UPDATE sessions_list SET end_time = start_time + INTERVAL 2 HOUR WHERE id_type_session = 1;
UPDATE sessions_list SET end_time = start_time + INTERVAL 30 MINUTE WHERE id_type_session = 2;
UPDATE sessions_list SET end_time = start_time + INTERVAL 90 MINUTE WHERE id_type_session = 3;
UPDATE sessions_list SET end_time = start_time + INTERVAL 150 MINUTE WHERE id_type_session = 4;

-- добавляем длительность сессии
SHOW VARIABLES LIKE 'sql_safe_updates';
SET SQL_SAFE_UPDATES = 0;
UPDATE sessions_list SET duration = SEC_TO_TIME((TIME_TO_SEC(end_time))-(TIME_TO_SEC(start_time)));
SELECT * FROM sessions_list;
SET SQL_SAFE_UPDATES = 1;
-- SELECT SEC_TO_TIME((TIME_TO_SEC(end_time))-(TIME_TO_SEC(start_time))) FROM sessions_list WHERE id = 2;
-- reports 
SHOW FULL COLUMNS FROM reports;
SELECT * FROM reports;
-- ALTER TABLE reports DROP COLUMN stars;
-- добавляем колонку stars
ALTER TABLE reports ADD stars TEXT AFTER resume;
UPDATE reports SET stars = end_coach_done;

-- coach_report + добавляем новую колонку stars
SHOW FULL COLUMNS FROM coach_report;
ALTER TABLE coach_report MODIFY COLUMN observation TEXT;
ALTER TABLE coach_report ADD stars TEXT AFTER observation;
