-- исправление принадлежности одного клиента двум разным коучам
-- самое большое количество сессий по 2 коучу отдадим только ему
SELECT id_client FROM sessions_list WHERE id_coach = 2 GROUP BY id_client ORDER BY COUNT(id) desc LIMIT 5;
UPDATE sessions_list SET id_coach = 2 WHERE id_client IN (SELECT id_client FROM (SELECT id_client FROM sessions_list WHERE id_coach = 2 GROUP BY id_client ORDER BY COUNT(id) desc LIMIT 5)x);
-- самое меньшее количество сессий по 2 коучу отдадим 1 
SELECT id_client FROM sessions_list WHERE id_coach = 2 GROUP BY id_client ORDER BY COUNT(id) LIMIT 6;
UPDATE sessions_list SET id_coach = 1 WHERE id_client IN (SELECT id_client FROM (SELECT id_client FROM sessions_list WHERE id_coach = 2 GROUP BY id_client ORDER BY COUNT(id) LIMIT 6)x);
-- корректируем еще
SELECT  id_client, COUNT(DISTINCT id_coach), COUNT(id) FROM sessions_list GROUP BY id_client ORDER BY COUNT(DISTINCT id_coach);
