-- проверяем по статусу клиента
SELECT  sl.id_client, c.id_clients_type, COUNT(DISTINCT sl.id_coach), COUNT(sl.id) 
	FROM sessions_list sl 
	JOIN clients c
		ON sl.id_client = c.id
        WHERE c.id_clients_type = 3
		GROUP BY id_client 
        ORDER BY COUNT(DISTINCT id_coach);

